description: 'Three population out-of-Africa with an extended pulse of         Neandertal
  admixture into Europeans

  Demographic model of an extended admixture pulse from Neandertals into Europenas
  taken from Iasi et al. (2021). This model simulates 3 populations: Africans, Europeans
  and Neandertals with an Out-of-Africa event. The population sizes are constant with
  an unidirectional admixture from Neandertals into Europeans after the split between
  Europeans and Africans. The admixture event is modelled as an 800 generation (20
  ky) long extended admixture pulse.'
